import React, { Component } from 'react'
import './setup.less';

export default class Setup extends Component {
  render() {
    return (
      <div className='setup-wrap'>
        <div className="arrow arrow-left" />
        <div className="setup-bar"></div>
        <div className="arrow arrow-right" />
      </div>
    )
  }
}
